INSERT INTO `content` VALUES (990,724,NULL,NULL,'<p>Use the subcategories to build out this section.</p>','',NULL,NULL),(991,725,NULL,NULL,'<p>Use subpages to build out this section.</p>','',NULL,NULL),(992,726,NULL,NULL,'<p>Use subpages to build out this section.</p>','',NULL,NULL),(993,718,NULL,NULL,'<ul>\n<li><a href=\"https://twitter.com/DavidMyrick\" target=\"_blank\" rel=\"noopener\">Twitter</a></li>\n<li><a href=\"https://www.instagram.com/davidmyrick/\" target=\"_blank\" rel=\"noopener\">Instagram</a></li>\n<li><a href=\"https://vimeo.com/davidmyrick\" target=\"_blank\" rel=\"noopener\">Vimeo</a></li>\n</ul>','',NULL,NULL),(994,720,NULL,NULL,'<ul>\n<li><a href=\"https://twitter.com/davidmyrick\" target=\"_blank\" rel=\"noopener\">Twitter</a></li>\n<li><a href=\"https://www.instagram.com/davidmyrick/\" target=\"_blank\" rel=\"noopener\">Instagram</a></li>\n<li><a href=\"https://vimeo.com/davidmyrick\" target=\"_blank\" rel=\"noopener\">Vimeo</a></li>\n</ul>','',NULL,NULL),(995,728,NULL,NULL,'<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/pics/Group 62.png\" alt=\"\" width=\"103\" height=\"30\"></p>\n<h1 style=\"text-align: center;\">DAVID J. MYRICK</h1>\n<hr>\n<div class=\"col\">Located In California.<br>IATSE Local 600 Member\n<div class=\"social standard\">\n<ul>\n<li><a href=\"https://instagram.com/davidmyrick\" target=\"_blank\" rel=\"noopener\">instagram</a></li>\n<li><a href=\"https://www.imdb.com/name/nm1651647/?ref_=fn_al_nm_1\" target=\"_blank\" rel=\"noopener\">imdb</a></li>\n<li><a href=\"https://vimeo.com/davidmyrick\" target=\"_blank\" rel=\"noopener\">vimeo</a></li>\n</ul>\n</div>\n</div>\n<div class=\"col\">Raised in California, grew up in a camera shop that was owned and operated by a father who had a passion for fine art photography. Visted the darkrooms of some of the greatest B&amp;W photographers of this decade, including Ansel Adams &amp; Edward Weston. Set out to make a career in film making with only a wild idea of this becoming a reality. Always approaching every job as an opportunity and an emotion on how to become better at what I set out to do.&nbsp;</div>','<div class=\"col\">\n<h3>AGENCY:</h3>\nUnited Talent Agency<br>9336 Civic Center Drive<br>Beverly Hills, CA 90210<br>t: 310-228-3839</div>\n<div class=\"col\">\n<h3>FEATURES:</h3>\nSophie Zelon<br><a href=\"mailto:sophie.zelon@unitedtalent.com\">sophie.zelon@unitedtalent.com</a></div>\n<div class=\"col\">\n<h3>COMMERCIALS &amp; MUSIC VIDEO</h3>\nMelody Sandoval<br><a href=\"mailto:melody.sandoval@unitedtalent.com\">melody.sandoval@unitedtalent.com</a></div>',NULL,NULL),(1035,NULL,15235,NULL,'<p>Director Dugan O\'neal</p>','',NULL,NULL),(996,NULL,15160,NULL,'<p>Feature Film by The Phillips Brother\'s</p>','',NULL,NULL),(997,NULL,15246,NULL,'<p>Director Matthew McDuffie</p>','',NULL,NULL),(998,NULL,15245,NULL,'<p>Director Dugan O\'Neal&nbsp;</p>','',NULL,NULL),(999,NULL,15250,NULL,'<p>Short Film by The Phillips Brother\'s</p>','',NULL,NULL),(1000,NULL,15249,NULL,'<p>Director Jake Hoffman&nbsp;</p>','',NULL,NULL),(1001,NULL,15248,NULL,'<p>Director Abdel Abonamous&nbsp;</p>','',NULL,NULL),(1038,NULL,15238,NULL,'<p>Director Richard Farmer</p>','',NULL,NULL),(1002,NULL,15242,NULL,'<p>Director Francesco Carrozzini</p>','',NULL,NULL),(1003,NULL,15253,NULL,'<p>Director Niel Krug</p>','',NULL,NULL),(1004,NULL,15254,NULL,'<p>Director James Frost</p>','',NULL,NULL),(1005,NULL,15255,NULL,'<p>Director&nbsp;Janell Shirtcliff</p>','',NULL,NULL),(1006,NULL,15256,NULL,'<p>Director Jamie James Medina</p>','',NULL,NULL),(1007,NULL,15257,NULL,'<p>Director Jodeb</p>','',NULL,NULL),(1008,NULL,15258,NULL,'<p>Director Dugan O\'neal</p>','',NULL,NULL),(1009,NULL,15259,NULL,'<p>Director Niel Krug</p>','',NULL,NULL),(1010,NULL,15261,NULL,'<p>Dirctor Ryx</p>','',NULL,NULL),(1011,NULL,15262,NULL,'<p>Vivo</p>','',NULL,NULL),(1012,NULL,15263,NULL,'<p>Director Aleysa Young</p>','',NULL,NULL),(1013,NULL,15264,NULL,'','',NULL,NULL),(1