eirmod tem</p>\n<p>por invidunt ut labore et dolore magna.Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolo sed diam nonumy eirmod tempor invidunt ut labore et doloLorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna.Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolo</p>','',NULL,NULL),(1033,NULL,15302,NULL,'<h2>CLOSING</h2>\n<p>Bottom line, the world you have created Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna.Lorem ipsum dolor sit amet, consetetur sadipscing elitr,</p>\n<p>References to call upon. I will have my agent give you contacts for this.</p>\n<p>Parker Phillips, Directror<br />Jonathan Sela, Cinematographer<br />Cassin Elwes, Producer<br />Kelly Mccormick, Producer</p>','',NULL,NULL),(1034,NULL,15285,NULL,'','',NULL,NULL),(1036,NULL,15244,NULL,'<p>Director Benjamin Kutsko</p>','',NULL,NULL),(1037,NULL,15241,NULL,'<p>Director The Weeknd</p>','',NULL,NULL),(1053,NULL,15378,NULL,'<p>Director Danny Lee</p>','',NULL,NULL),(1039,NULL,15237,NULL,'<p>Director Arnaud Boutin</p>','',NULL,NULL),(1040,NULL,15243,NULL,'<p>Director Dominique Deleon</p>','',NULL,NULL),(1041,NULL,15304,NULL,'<p>Peacock &amp; Universal Content</p>','',NULL,NULL),(1048,NULL,15373,NULL,'<p>DIRECTOR&nbsp;SPENCER RIVERA</p>\n<p>\"WALTER THE CAT\"</p>','',NULL,NULL),(1042,NULL,15236,NULL,'<p>Director Abdel Abonamous</p>','',NULL,NULL),(1043,NULL,15303,NULL,'','',NULL,NULL),(1044,NULL,15305,NULL,'<h2 style=\"text-align: center;\">INTRODUCTION</h2>\n<p dir=\"ltr\">I absolutely loved the story. I have had experiences seeing people close to me, going through this struggle, which brings a level of personal connection. Behind our story is a beautiful drama of personal connection, of human relationships, of discomfort, and of struggle. It&rsquo;s the part of war that films rarely touch on, or just allude to. This film is about living through the parts of life that we often shy away from thinking about.&nbsp;</p>\n<p dir=\"ltr\">&nbsp;What I&rsquo;m getting at is that it\'s very different from what we usually get out of a story, which means we need a unique visual style to differentiate it from a traditional war film. Through the use of inventive photography, I wish to represent the world through his eyes, such as attention to the slightest details and brilliant textures of the environment, to feel a sense of being on edge, being constantly aware. I want to embrace the grayness, the washed out color, the desaturated view of the world, when fall provides us so much color to play with.</p>\n<p dir=\"ltr\">While the majority of the audience has no comprehension of this struggle, we all know how it feels to be looked over, to be alone, and to struggle, and I believe through these visual techniques we can bridge the gap for the connection between the audience and Calvin. And while they may not totally understand it, I can help the audience to feel these emotions, and throughout his recovery, as we use less wide shots, as we use more still shots, they will feel a newfound sense of ease.&nbsp;</p>','',NULL,NULL),(1045,NULL,15340,NULL,'','',NULL,NULL),(1046,NULL,15345,NULL,'','',NULL,NULL),(1047,NULL,15347,NULL,'','',NULL,NULL),(1049,NULL,15374,NULL,'<p>Director Robby Dugan</p>','',NULL,NULL),(1050,NULL,15375,NULL,'','',NULL,NULL),(1051,NULL,15376,NULL,'<p>by Danny Lee</p>','',NULL,NULL),(1052,NULL,15377,NULL,'<p>by Judd Bloch</p>','',NULL,NULL);
