labore et dolore magna.Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolo</p>','COLOR TEXT','no',8,'text','live','filename'),(258,NULL,15284,'','IMAGES','yes',10,'grid - justified','live','drag'),(259,NULL,15284,'','CLOSING','yes',11,'fullwidth','live','filename'),(261,NULL,15303,'','INTRODUCTION','yes',2,'fullwidth','live','filename'),(262,NULL,15303,'<h2 dir=\"ltr\" style=\"text-align: center;\">CINEMATOGRAPHY VIBE</h2>\n<p dir=\"ltr\">The visual language of this film has to be very unique in order to match the demands of such a complicated struggle. I believe there is merit in the idea of filming from behind, especially for moments like walking out of jail, to when the sounds and voices play in his head. Watching from behind as he wears the headphones in the VA clinic, seeing his body language, before going to a close-up of the therapist pointing at another memory on his timeline. Emphasizing the wincing of his eyes as the ringing gets louder.&nbsp;&nbsp;</p>\n<p dir=\"ltr\">Hiding our character&rsquo;s face for a few shots adds to the shapelessness, the sense of outside-in that we feel when people are staring at us, when we don&rsquo;t exactly fit into society. Using high positioned cameras, to look down at our actor in his moments of despair and helplessness. And the use of extreme close-ups to create a fastening between the audience and Calvin&rsquo;s mind. I believe in these unique camera positions, we can help to control the feeling of the audience toward Calvin. A character who, most people would just walk past on the street, without giving it a second thought. Someone who is ignored by our population.&nbsp;</p>','CINEMATOGRAPHY VIBE','yes',4,'text','live','filename'),(265,NULL,15303,'<h2 dir=\"ltr\" style=\"text-align: center;\">CINEMATOGRAPHY VIBE&nbsp;</h2>\n<p dir=\"ltr\">Just as important as it is to help the audience understand Calvin&rsquo;s physical and mental struggle through the use of close-ups, handheld camera, etc, we need to show the emotional struggle that he and so many people like him face everyday. The feeling of abandonment, isolation, fear, aimlessness. Through clever framing, making him feel small to the audience, making him feel trapped, or lost. Such as having Calvin boxed off when he encounters Alice in the VA hallway. We can back off, maybe have him framed in by a doorway, or put a physical barrier between the two characters.&nbsp;</p>\n<p dir=\"ltr\">This script, more than most, makes use of flashbacks to show the audience the journey that this character has been through that made him who he is. And with how much this script goes back and forth between the present and the past, it is important to make a visual distinction between the present and the past. I have a unique custom lens, which I will attach examples of. But more than that, I believe through use of color, difference in color, shot types, framing, and an overall change in visual language would be important. Perhaps even evolving that language throughout the film, until we catch up to the present. When we match cut to the haunted stare from Calvin, as we reach the final event on his timeline.&nbsp;</p>','CINEMATOGRAPHY VIBE Pt2','no',7,'text','live','filename'),(263,NULL,15303,'','1st Pictures ','no',3,'grid - justified','live','drag'),(264,NULL,15303,'','2nd Pictures ','no',6,'grid - justified','live','drag'),(266,NULL,15303,'','3rd Pictures','no',8,'grid - justified','live','filename'),(267,NULL,15303,'<h2 dir=\"ltr\" style=\"text-align: center;\"><strong>CHARACTER</strong></h2>\n<p dir=\"ltr\"><strong>Calvin </strong>- A man plagued with regret, pain, and anger. The loss of a child is unimaginable, and a step beyond what the audience is expecting to add onto everything else he&rsquo;s already struggling with. Surviving a grenade blast, losing a brother in arms and in marriage, returning home to a world he doesn&rsquo;t recognize, only to lose more than a parent ever should. His story is told through his eyes. He&rsquo;s been through so much loss.</p>\n<p dir=\"ltr\">It would be ideal to make use of POV shots for him, and to get many extreme close ups of his eyes.&nbsp;</p>','CHARACTER','yes',9,'text','live','filename'),(268,NULL,15303,'','character pics','no',10,'grid - masonry','live','drag'),(269,NULL,15303,'<h2 dir=\"ltr\" style=\"text-align: center;\"><strong>CHARACTER</strong></h2>\n<p dir=\"ltr\"><strong>Whitney</strong> - A veteran who lost everything fighting for a country that didn&rsquo;t appreciate him, only to be thrown away by the country he fought for. After getting out of prison, he seeks retribution with the family he abandoned.&nbsp;</p>\n<p dir=\"ltr\">It would be great to explore his progress through visual movement on the screen, slowly showing him metaphorically getting closer to his goals throughout the film.</p>','CHARACTER pt 2','no',11,'text','live','filename'),(270,NULL,15303,'','Character pics pt 2','no',12,'grid - justified','live','filename'),(271,NULL,15303,'<h2 style=\"text-align: center;\">FLASHBACKS</h2>\n<p>This film lives with the flashback, it&rsquo;s something that really needs to separate its self from the rest of the movie. As I mentioned prior, maybe its with a unique lens or lighting. This is something I would love to explore with you. I think getting abstract is one of my specialties as as cinematographer. Coming form Music Video&rsquo;s and having to act fast in a situation to make something interesting to the eye is my special place. I think using shallow depth of field and making the audience see exactly what we what them to think is a real art in it&rsquo;s own. This is a part of the film that I really would love to dive deep on with you, because it&rsquo;s something I am very strong at. Let\'s make art!</p>','FLASHBACKS','yes',13,'text','live','filename'),(272,NULL,15303,'','Large Image - Restaurant ','no',5,'grid - justified','live','filename'),(273,NULL,15303,'','Flashback Images','no',14,'grid - justified','live','drag'),(274,NULL,15303,'<h2 style=\"text-align: center;\">THANK YOU</h2>\n<p>It was a real pleasure getting to read this Script and also getting the opportunity to share some thoughts on something that must be so personal to you. You really brought some attention to a topic that is so relevant in todays society. I see that you put together a true character study at its best. Look forward to seeing what you create. I would hope that we could have a conversation about how you see this film taking shape. I will leave you with some links with a recent dark drama I just did in Mississippi last year. I think you will get an idea of what I bring to the table and how I see things.&nbsp;</p>','THANK YOU','yes',15,'text','live','filename'),(275,NULL,15303,'','Thank You Images','no',16,'grid - justified','live','drag'),(276,NULL,15303,'','Open Page','no',1,'fullwidth','live','filename'),(277,NULL,15344,'<p>https://player.vimeo.com/progressive_redirect/playback/721380020/rendition/1080p/file.mp4?loc=external&amp;signature=013dee5e8412dec1906718f0829299892a13e15ffd17fa778be568ba0c723e9f</p>','OPEN PAGE','no',100,'text','live','filename'),(278,NULL,15344,'','Open Movement test','no',100,'grid - justified','live','filename'),(279,NULL,15344,'','test 3','no',100,'grid - justified','live','filename'),(280,NULL,15347,'<h3>I have never in my career, read a script where the director has not only had such a clear vision so early on in the process but also supported that vision with proof of concept. You have such a uniquely crafted script and I can feel all of the different styles of filmmaking and yet you have put your own stamp on it. This is clearly a very personal story because I feel the thread that connects these characters throughout every scene and the thread just seems to get more tightly strung as each scene unfolds as we learn so much more about their relationships about each of them and the weight that each of them carry. Not only within themselves&hellip;. But with each other.</h3>\n<h3>That universal longing, wanting, hoping and ultimately&hellip;..the choices that navigate them.</h3>\n<h3>&nbsp;</h3>\n<h3>It&rsquo;s honestly the most inspired I have ever been reading a script but also motivating because I want to find a way to visually marry your dialogue, mood and descriptive visuals that you have already incorporated into the script.</h3>','Intro Part 1','no',3,'text','live','filename'),(281,NULL,15347,'','Title Page','no',1,'fullwidth','live','filename'),(282,NULL,15347,'<h3>I see that you have a strong vision and will be looking for a strong director of photography to run the ship since you will also be acting. I see me sitting shotgun making sure we steer the vessel in the right direction. I am here to bring your vision to light and this really excites me because we can collaborate to make it better as a team. I can&rsquo;t tell you how excited I am to run with this type of vision. In the past, it&rsquo;s always been me trying to pull that out of a director and running with what I can on set and with the small amount of prep that we usually get.</h3>\n<h3>This is, from the ground up, already designed&hellip;.from what I see&hellip;&hellip;it&rsquo;s masterful.</h3>\n<h3>Imagine how much farther we could grow with where you are already starting in prep.</h3>','Intro Part 2','no',5,'text','live','filename'),(283,NULL,15347,'','Poetic Language','no',6,'fullwidth','live','filename'),(284,NULL,15347,'<h3>One of the reasons that this script has really resonated with me outside of the beautiful story is that I really identify with is the relationship between Caleb and Shawn. I grew up with a friend named Sean and he was the guy I always thought could do anything, maybe more than I could have ever done. He had this way of making anything happen and in our early years in middle school, we thought we would rule the world together.<span class=\"Apple-converted-space\">&nbsp;</span></h3>\n<h3>In high school, he was moving towards a college scholarship for football but eventually&hellip;..his surroundings caught up to him. His uncles were not the best influence on him and by the time we graduated high school, he was already seeing his first jail time. Then, by the time I decided I was leaving town to chase my dreams in Hollywood, he was visiting prison for the first lengthy amount of time. So many aspects of this story flows through my experiences with Sean.</h3>','Intro Part 3','no',7,'text','live','filename'),(285,NULL,15347,'','THREAD NEEDLE IMAGE','no',8,'fullwidth','live','filename'),(286,NULL,15347,'<h2>Threading the needle.</h2>\n<h3>Something I really wanna dive into first with you is the road map to this script. It all takes places with Shaun&rsquo;s VO that describes the past, present and future. The use of Pre laps and the poetry that Shaun shares is so deep&hellip;&hellip;so very deep. Not just in his personal story and experiences but in what&rsquo;s happening in the world today&hellip;..what has always been happening but also&hellip;.as a fan of Rap and Basketball&hellip;..it runs even deeper.</h3>\n<h3>It is the lifeline and veins of this script. This would be our first jumping off point of collaboration that I would seek with you, I truly think this is the beginning of our &lsquo;tip off&rsquo;.</h3>','THREADING THE NEEDLE','no',9,'text','live','filename'),(287,NULL,15347,'<h2>The White Room..</h2>\n<h3>I don&rsquo;t know where to start with this unbelievable concept. This is where a maestro fully lets the creativity breathe a new layer of visual story telling in the movie. I always ask directors when making an indie film., &lsquo;where is the visual heart beat? Where is that one cinematic thing you take away from a movie? The thing that visually stuck with you after watching the film?&rsquo;</h3>\n<h3>For me&hellip;.&rsquo;Requiem For a Dream&rsquo; was the close ups of the eyeball dilating, needles and torches in such a creative light. That&rsquo;s when the cinematographer makes his move in conjunction with a director that has such a vision.<span class=\"Apple-converted-space\">&nbsp;</span></h3>\n<h3>I have an idea of once the white room starts to deteriorate, could we end up projecting images on white fog and capturing that.</h3>\n<h3>My question for you is&hellip;../how creative and dirty can we get in the White Room???</h3>','THE WHITE ROOM','no',10,'text','live','filename'),(288,NULL,15347,'<h2>The Constant Changing Horizon&hellip;</h2>\n<h3>The use of this visual tool through the movie is very poetic, it takes me back to using the music video skills I have acquired in past years. The way you see this taking place throughout the movie is very tasteful. I seeing this going from changing horizons that meld perfectly with an individual laying in bed and this inspires me. Making these seamless and powerful. I see this as a place we can build on and do something different than what people have done and seen in the past.<span class=\"Apple-converted-space\">&nbsp;</span></h3>','The Constant Changing HorizoN','no',12,'text','live','filename'),(289,NULL,15347,'','END CREDIT','no',13,'fullwidth','live','filename'),(290,NULL,15347,'','White Room Images','no',11,'grid - masonry','live','filename'),(291,NULL,15347,'','title page part 2','no',2,'fullwidth','live','filename'),(292,NULL,15347,'','between intro part 1','no',4,'fullwidth','live','filename');
